import React from 'react';

function Header() {
    return (
        <div className="header">
            <h1 className="tesla-logo" alt="This is a Tesla logo">
                {/* <a href="/"> */}
                    <img src="./../../assets/tesla-logo.png" alt="Tesla logo"></img>
                {/* </a> */}
            </h1>
        </div>
    );
}

export default Header;
